def predictClientGlobal(X):
    var = X.tolist()
    #print(var[0])
    suppClient = var[0]
    confClient= var[1]
    suppGlobal = var[2]
    confGlobal= var[3]
    
    idSearchClient = random.choice(list(allTransactions.keys()))
    _trainAll = []
    _trainClient = []
    _testClient = []

    #Clasificar las transacciones en sus respectivos grupos
    for client, dates in allTransactions.items():
        for date, transactions in dates.items():
            currentDate = time.strptime(date, "%d/%m/%Y")
            for idTransaction, items in transactions.items():
                if(client == idSearchClient):
                    if(currentDate<dueDate):
                        _trainClient.append(items)
                    else:
                        _testClient.append(items)
                else:
                    _trainAll.append(items)
    
    #Generar reglas del cliente
    resulTrainClient = fpgrowth(suppClient,confClient,_trainClient)
    
    #Generar reglas del resto de clientes
    resulTrainGlobal = fpgrowth(suppGlobal,confGlobal,_trainAll)
    
    #Generar lista de prediccion de articulos
    _listPrediction = []
    #Desde el cliente
    for i in resulTrainClient:
        _listPrediction.append(tuple(i)[0])
    #Desde el resto
    for i in resulTrainGlobal:
        _listPrediction.append(tuple(i)[0])
    
#     #Remover duplicados
#     _listPrediction = list(dict.fromkeys(_listPrediction))
    
    #Lista de productos comprados en las transacciones de test
    _listTest = []
    for invoice in _testClient:
        for item in invoice:
            _listTest.append(item)
            
#     #Remover articulos duplicados
#     _listTest = list(dict.fromkeys(_listTest))

    #Si no contiene ninguna prediccion o si el cliente no realizo
    #compras en el 2020, entonces retorna un valor minimo con el
    #fin de pasar al siguiente cliente
    if(len(_listTest) == 0 or len(_listPrediction) == 0):
        return -0.01
    
    result = accuracy_percentage(_listPrediction, _listTest)
    resPred = list(_listPrediction)
    resTest = list(_listTest)
    #print(result)
    #Obtener el porcentaje de aciertos
    return -result


